import styles from './InputAnswer.module.css'
const InputAnswer = ({ inputText }) => {

  return (
    <ul className={styles['input-answer']}>
      {inputText.map((list, idx) => <li key={idx}>
        {`${list.username} (${list.age} years old)}`}
      </li>)}
    </ul>
  )
}

export default InputAnswer
